import firebase from "firebase";

const config = {
  apiKey: "AIzaSyBeh3z6RnmNw9gfaI1bYEjczOIp1NwFu8c",
  authDomain: "slack-chat-d7f1b.firebaseapp.com",
  databaseURL: "https://slack-chat-d7f1b.firebaseio.com",
  messagingSenderId: "140889684004",
  projectId: "slack-chat-d7f1b",
  storageBucket: "slack-chat-d7f1b.appspot.com"
};

firebase.initializeApp(config);

export default firebase;
